import React from 'react';
import './App.css';

export default class LandingPage extends React.Component {
  constructor(props) {
    super(props)
    this.nav = props.nav
  }

  toLandingPage(e) {
    console.log(e)
  }

  render() {
    return <div>
      <button onClick={this.toLandingPage()}>Landing Page</button>
      <h1>Landing Page</h1>
    </div>
  }
}
